import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Welcome To Ten Peaks Lookout!</h1>
      <footer>
        <div className="WeatherAndTime">
          1:09pm
        </div>
        <div className="InformationBox">
          Tip: Lorem Ipsum
        </div>
      </footer>
    </div>
  );
}

export default App;
